import { Card, Col, Dropdown, Menu, Row } from 'antd'
import React from 'react'
import { Link } from 'react-router-dom';
import Avatar from '../../../assets/img/avatar.png';
import More from '../../../assets/img/iconos/more_vert-24px.svg'

import './CardNode.scss';

export default function CardNode() {

    const menu = (
        <Menu>
          <Menu.Item key="0">
            <Menu.Item key="3"><Link to="/miempresa-edit">Editar datos</Link></Menu.Item>
          </Menu.Item>
        </Menu>
      );

    return (
        <div className="CardNode">
            <Row style={{textAlign: "left"}} className="dividerBottom">
                <Col span={5}>
                    <p><img style={{marginTop: "-5px"}} alt="ico" width="60" src={Avatar} /></p>
                </Col>
                <Col span={16}>
                    <span>Panchita Lopez</span><br/>
                    <span><b>directora de marketing</b></span>
                </Col>
                <Col span={3}>
                    <Dropdown overlay={menu} trigger={['click']}>
                        <Link to="#" className="ant-dropdown-link" onClick={e => e.preventDefault()}><img style={{marginTop: "5px"}} alt="logo" src={More} width="30" height="30" /></Link>
                    </Dropdown>
                </Col>
            </Row>
        </div>
    )
}
